import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { CreateEmployee, DetailEmployee, ListEmployee } from "./pages";
import { Routes } from "./Routes";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route
            path={Routes.CreateEmployee}
            exact
            component={CreateEmployee}
          />
          <Route path={Routes.ListEmployee} component={ListEmployee} />
          <Route path={Routes.EmployeeDetail} component={DetailEmployee} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
